import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the "Electronics" category card. This is a more specific selector
    // than just a link with the text "Electronics", as it targets the visual card element.
    const electronicsCategoryCard = page.locator('.category-card:has-text("Electronics")');

    // Wait for the element to be visible
    await electronicsCategoryCard.waitFor({ state: 'visible' });

    // Take a screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_click.png'));

    // Click on the Electronics category card
    await electronicsCategoryCard.click();

    // Take a screenshot after clicking to show the result (e.g., focus state)
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_click.png'));

    return {
      success: true,
      action: "Successfully navigated to the Electronics category by clicking the category card.",
      extractedData: {
        clickedElement: "div.category-card with text 'Electronics'"
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to the Electronics category.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
